import {
  BrowserRouter as Routes,
  Route,
  BrowserRouter,
} from "react-router-dom";
import Navbar from "./components/Navbar";
import Herosection from "./components/Herosection";
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Herosection />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
